@Hydrogen9826
60FPS is meant for fast-paced scenes on TV and sports. The difference is substantial. This episode of Dexter though had nothing worth the 60FPS. If you download an MMA torrent of mine, you'd see what I mean. It creates a smoother transition rather than a blur of pixels during motion shots.

@hmathews8
Pretty much same as the reply above, except the  bitrate of the video can be manually changed during the capture, and kept it at a medium level. I'm thinking of upping the bitrate for next week, but I'm trying not to let the 60FPS + bitrate affect the filesize too much. 

@Everyone
If you're experiencing slow download speeds, look at the seeders/leechers and you'll know why. There's only about half the amount of people downloading as there is uploading, and upload speeds are typically much slower than download. I'm uploading at 6MB/s, and see a few others uploading from 500kb/s to 1.5MB/s. Your download speed in comparison to what is being seeded is most likely the problem, and most seem to be seeding. Remember, just because there's a lot of seeders on a file does not mean it's going to go fast. It all depends on the ratio of leechers to seeders.
